prod[a, b] - (-1)^(|a|\[CenterDot]|b|) prod[b, a], where |a| is the grade of \
a. Supercommutator[prod] is a SuperAnticommutative product. If prod is \
associative then Supercommutator[prod] obeys a graded Jacobi identity and \
defines a graded Lie algebra."
 
