     "There is more than one term on the LHS of rule."
 
MakeRule /: MakeRule::usage = "MakeRule[{LHS, RHS}] gives a list of delayed \
rules with left and right hand sides as given by LHS and RHS respectively, \
but moving indices to consider all possible equivalent rules. See notes for \
its options PatternIndices, MetricOn, UseSymmetries and TestIndices. \
MakeRule[{LHS, RHS, conditions}] adds conditions to the rules."
 
Attributes[xAct`xTensor`Private`ReplaceIsolated] = {HoldFirst}
 
xAct`xTensor`Private`ReplaceIsolated[xAct`xTensor`Private`expr_] := 
