       xAct`xTensor`Private`expr, xAct`xTensor`Private`f], 
      xAct`xTensor`Private`RecursiveIsolated], xAct`xTensor`Private`f]
 
xAct`xTensor`Private`EvaluateHeld[xAct`xTensor`Private`expr_, 
     xAct`xTensor`Private`f_] := xEvaluateAt[xAct`xTensor`Private`expr, 
     (Drop[#1, -1] & ) /@ Position[xAct`xTensor`Private`expr, 
       xAct`xTensor`Private`f]]
 
