     xAct`xTensor`Private`f_] := Unevaluated[xAct`xTensor`Private`expr] /. 
     {LieD[xAct`xTensor`Private`v_][xAct`xTensor`Private`x_] :> 
       LieD[xAct`xTensor`Private`RecursiveIsolated[xAct`xTensor`Private`f[
           xAct`xTensor`Private`v], xAct`xTensor`Private`f]][
        xAct`xTensor`Private`RecursiveIsolated[xAct`xTensor`Private`x, 
         xAct`xTensor`Private`f]], Scalar[xAct`xTensor`Private`v_] :> 
       Scalar[xAct`xTensor`Private`RecursiveIsolated[xAct`xTensor`Private`f[
          xAct`xTensor`Private`v], xAct`xTensor`Private`f]], 
      Dir[xAct`xTensor`Private`v_] :> 
       Dir[xAct`xTensor`Private`RecursiveIsolated[xAct`xTensor`Private`f[
          xAct`xTensor`Private`v], xAct`xTensor`Private`f]], 
      Bracket[xAct`xTensor`Private`v1_, xAct`xTensor`Private`v2_] :> 
       Bracket[xAct`xTensor`Private`RecursiveIsolated[xAct`xTensor`Private`f[
          xAct`xTensor`Private`v1], xAct`xTensor`Private`f], 
        xAct`xTensor`Private`RecursiveIsolated[xAct`xTensor`Private`f[
          xAct`xTensor`Private`v2], xAct`xTensor`Private`f]]}
 
Attributes[xAct`xTensor`Private`replall] = {HoldFirst}
 
xAct`xTensor`Private`replall[xAct`xTensor`Private`expr_] := 
    Module[{xAct`xTensor`Private`inds = 
       xAct`xTensor`Private`FindFreeAndDummyIndices[
        xAct`xTensor`Private`expr], xAct`xTensor`Private`frees, 
      xAct`xTensor`Private`dummies}, xAct`xTensor`Private`frees = 
       (#1 -> DummyAs[#1] & ) /@ First[xAct`xTensor`Private`inds]; 
      xAct`xTensor`Private`dummies = xAct`xTensor`Private`DuplicateRule /@ 
        (#1 -> DummyAs[#1] & ) /@ Last[xAct`xTensor`Private`inds]; 
      ReplaceIndex[xAct`xTensor`Private`expr, 
       List @@ Join[xAct`xTensor`Private`frees, 
         xAct`xTensor`Private`dummies]]]
 
Attributes[xAct`xTensor`Private`FindFreeAndDummyIndices] = {HoldFirst}
 
xAct`xTensor`Private`FindFreeAndDummyIndices[xAct`xTensor`Private`expr_] := 
    ({xAct`xTensor`Private`TakeFrees[#1], xAct`xTensor`Private`TakeUp[
        xAct`xTensor`Private`TakeOrderedEPairs[#1]]} & )[
     FindIndices[xAct`xTensor`Private`expr]]
 
xAct`xTensor`Private`TakeFrees[xAct`xTensor`Private`list_] := 
