    {xAct`xTensor`Private`list, 1}
 
xAct`xTensor`Private`next2[{xAct`xTensor`Private`list___, 0, 0}] := 
    Sequence[{xAct`xTensor`Private`list, 0, 1}, {xAct`xTensor`Private`list, 
      0, 2}]
 
PatternIndices /: PatternIndices::usage = "PatternIndices is an option for \
MakeRule expressing the indices that will be converted into patterns in the \
final expression of the rule. Possible values are None (default), All or a \
list of indices."
 
TestIndices /: TestIndices::usage = "TestIndices is a Boolean option for \
MakeRule. TestIndices->True (default) means that patterntests are added to \
the indices of the rules to check that they belong to the right vector \
bundle."
 
MetricOn /: MetricOn::usage = "MetricOn is an option for MakeRule. \
MetricOn->None (default) means that no index can be raised or lowered. \
MetricOn->All means that all indices can be raised or lowered. MetricOn->{i1, \
i2, ...} explicitly gives the list of indices that can be raised or lowered \
with the metric. This option is not relevant if there is no metric."
 
UseSymmetries /: UseSymmetries::usage = "UseSymmetries is a Boolean option \
for MakeRule. UseSymmetries->True (default) means that symmetries of the \
tensors are considered to construct the rules."
 
ContractMetrics /: ContractMetrics::usage = "ContractMetrics is a Boolean \
option for MakeRule that specifies that all metric objects must be contracted \
(if possible) in the RHS of the rules. Its default value is False."
 
xAct`xTensor`Private`careQ[
     xAct`xTensor`Private`sortedexpr_xAct`xTensor`Private`Object, 
     xAct`xTensor`Private`options___] := 
    xAct`xTensor`Private`RiskyDers[xAct`xTensor`Private`sortedexpr] =!= {}
 
xAct`xTensor`Private`RiskyDers[
     xAct`xTensor`Private`sortedexpr_xAct`xTensor`Private`Object] := 
    With[{xAct`xTensor`Private`dersin = xAct`xTensor`Private`DersIn[
        xAct`xTensor`Private`sortedexpr]}, 
     Cases[Union[Join[Flatten[Outer[xAct`xTensor`Private`riskydermetricQ, 
          xAct`xTensor`Private`dersin, xAct`xTensor`Private`MetricsIn[
           xAct`xTensor`Private`sortedexpr]]], 
        Flatten[Outer[xAct`xTensor`Private`riskyderbasisQ, 
          xAct`xTensor`Private`dersin, xAct`xTensor`Private`BasesIn[
           xAct`xTensor`Private`sortedexpr]]]]], _xAct`xTensor`Private`risk]]
 
xAct`xTensor`Private`DersIn[
     xAct`xTensor`Private`sortedexpr_xAct`xTensor`Private`Object] := 
    Union[xAct`xTensor`Private`sortder /@ 
      Cases[xAct`xTensor`Private`sortedexpr, 
       xAct`xTensor`Private`MyDer[xAct`xTensor`Private`der_] -> 
        xAct`xTensor`Private`der, {0, Infinity}]]
 
