      (xAct`xTensor`Private`ind_)?CDIndexQ]] := 
    xAct`xTensor`Private`derwithindex[xAct`xTensor`Private`covd, 
     xAct`xTensor`Private`ind]
 
xAct`xTensor`Private`sortder[(xAct`xTensor`Private`covd_)?CovDQ[
      xAct`xTensor`Private`ind_]] := xAct`xTensor`Private`deronvbundle[
     xAct`xTensor`Private`covd, VBundleOfIndex[xAct`xTensor`Private`ind]]
 
xAct`xTensor`Private`ToCanonicalDir[Dir[xAct`xTensor`Private`expr_]] := 
    Dir[xAct`xTensor`Private`ToCanonicalDir[xAct`xTensor`Private`expr]]
 
xAct`xTensor`Private`ToCanonicalDir[xAct`xTensor`Private`expr_] := 
    With[{xAct`xTensor`Private`indices = IndexList @@ $AbstractIndices, 
      xAct`xTensor`Private`index = xAct`xTensor`Private`UltraindexOf[
        xAct`xTensor`Private`expr]}, Simplify[ReplaceIndex[
       ReplaceDummies[ToCanonical[xAct`xTensor`Private`expr, 
         xAct`xTensor`Private`$TCOptions], 
        Rest[xAct`xTensor`Private`indices]], xAct`xTensor`Private`index :> 
        If[UpIndexQ[xAct`xTensor`Private`index], UpIndex, DownIndex][
         First[xAct`xTensor`Private`indices]]]]]
 
$AbstractIndices := Flatten[IndicesOfVBundle /@ $VBundles]
 
$AbstractIndices /: $AbstractIndices::usage = "$AbstractIndices is a global \
variables storing the list of all currently defined abstract indices, \
including those internally generated."
 
$VBundles := {TangentM4}
 
