CollectTensors[xAct`xTras`Private`expr_, (xAct`xTras`Private`options___)?
      OptionQ] := Module[{xAct`xTras`Private`verbose, 
      xAct`xTras`Private`print, xAct`xTras`Private`time, 
      xAct`xTras`Private`method, xAct`xTras`Private`simplify, 
      xAct`xTras`Private`rtc, xAct`xTras`Private`mod, 
      xAct`xTras`Private`dummies, xAct`xTras`Private`tcs, 
      xAct`xTras`Private`tcscanon, xAct`xTras`Private`tcscanondd}, 
     {xAct`xTras`Private`method, xAct`xTras`Private`simplify, 
        xAct`xTras`Private`rtc, xAct`xTras`Private`verbose} = 
       {CollectMethod, SimplifyMethod, RemoveTensorWrapper, Verbose} /. 
         CheckOptions[xAct`xTras`Private`options] /. Options[CollectTensors]; 
      xAct`xTras`Private`verbose = TrueQ[xAct`xTras`Private`verbose]; 
      xAct`xTras`Private`rtc = TrueQ[xAct`xTras`Private`rtc]; 
      If[xAct`xTras`Private`verbose, xAct`xTras`Private`time = 
         AbsoluteTime[]; Print[
         "** Collecting tensors in expression of length ", 
         ToString[Length[xAct`xTras`Private`expr]], " and head ", 
         ToString[Head[xAct`xTras`Private`expr]], "."]; 
        xAct`xTras`Private`print[xAct`xTras`Private`msg_] := 
         (Print["** ", xAct`xTras`Private`msg, " in ", 
           ToString[Round[AbsoluteTime[] - xAct`xTras`Private`time, 0.01]], 
           "s."]; xAct`xTras`Private`time = AbsoluteTime[]; ), 
       xAct`xTras`Private`print[xAct`xTras`Private`msg_] := Null]; 
      If[xAct`xTras`Private`rtc, xAct`xTras`Private`rtc = 
        RemoveTensorWrapper, xAct`xTras`Private`rtc = Identity]; 
      If[ !FreeQ[xAct`xTras`Private`expr, Perturbation], 
       xAct`xTras`Private`method = Identity; ]; 
      If[xAct`xTras`Private`method === Default, 
       xAct`xTras`Private`method = ToCanonical[ContractMetric[#1]] & ; ]; 
      If[ !FreeQ[xAct`xTras`Private`expr, Scalar], 
       If[xAct`xTras`Private`verbose, xAct`xTras`Private`mod = 
          MapTimedIfPlus[xAct`xTras`Private`ExpandTensors[NoScalar[#1]] & , 
           xAct`xTras`Private`expr, Description -> 
            "Removing Scalar heads and expanding tensorial terms"]; , 
        xAct`xTras`Private`mod = MapIfPlus[xAct`xTras`Private`ExpandTensors[
             NoScalar[#1]] & , xAct`xTras`Private`expr]; ], 
       If[xAct`xTras`Private`verbose, xAct`xTras`Private`mod = 
          MapTimedIfPlus[xAct`xTras`Private`ExpandTensors[#1] & , 
           xAct`xTras`Private`expr, Description -> 
            "Expanding tensorial terms"]; , xAct`xTras`Private`mod = 
          MapIfPlus[xAct`xTras`Private`ExpandTensors[#1] & , 
           xAct`xTras`Private`expr]; ]]; xAct`xTras`Private`print[
       StringJoin["Expanded to ", ToString[Length[xAct`xTras`Private`mod]], 
        " tensorial terms"]]; xAct`xTras`Private`dummies = 
       Sort[xAct`xTensor`Private`IndexName /@ FindDummyIndices[
          Evaluate[xAct`xTras`Private`mod]]]; xAct`xTras`Private`print[
       StringJoin["Found ", ToString[Length[xAct`xTras`Private`dummies]], 
        " dummies, ", ToString[Shallow[List @@ 
           xAct`xTras`Private`dummies]]]]; 
      If[Length[xAct`xTras`Private`dummies] > 0, 
       xAct`xTras`Private`mod = xAct`xTensor`Private`ReplaceDummies2[
          xAct`xTras`Private`mod, xAct`xTras`Private`dummies]; 
        xAct`xTras`Private`print["Replaced dummies"]; ]; 
      xAct`xTras`Private`mod = Block[{$RecursionLimit = 4096}, 
        TensorWrapper[xAct`xTras`Private`mod]]; xAct`xTras`Private`print[
       "Applied TensorWrapper"]; xAct`xTras`Private`tcs = 
       Union[Cases[xAct`xTras`Private`mod, HoldPattern[TensorWrapper[_]], 
         {0, Infinity}, Heads -> True]]; xAct`xTras`Private`print[
       StringJoin["Found ", ToString[Length[xAct`xTras`Private`tcs]], 
        " TensorWrappers"]]; xAct`xTras`Private`tcscanon = 
       If[ !xAct`xTras`Private`verbose, xAct`xTras`Private`tcs /. 
         HoldPattern[TensorWrapper[xAct`xTras`Private`arg_]] :> 
          TensorWrapper[xAct`xTensor`Private`ReplaceDummies2[
            xAct`xTras`Private`method[xAct`xTras`Private`arg], 
            xAct`xTras`Private`dummies]], MapTimed[
         #1 /. HoldPattern[TensorWrapper[xAct`xTras`Private`arg_]] :> 
            TensorWrapper[xAct`xTensor`Private`ReplaceDummies2[
              xAct`xTras`Private`method[xAct`xTras`Private`arg], 
              xAct`xTras`Private`dummies]] & , xAct`xTras`Private`tcs, 
         Description -> "Canonicalizing TensorWrappers"]]; 
      xAct`xTras`Private`tcscanondd = 
       Union[Cases[xAct`xTras`Private`tcscanon, HoldPattern[
          TensorWrapper[_]], {0, Infinity}, Heads -> True]]; 
      xAct`xTras`Private`print[StringJoin["Canonicalized ", 
        ToString[Length[xAct`xTras`Private`tcscanondd]], " TensorWrappers"]]; 
      xAct`xTras`Private`mod = xAct`xTras`Private`mod /. 
        Inner[Rule, xAct`xTras`Private`tcs, xAct`xTras`Private`tcscanon, 
         List]; xAct`xTras`Private`print["Replaced TensorWrappers"]; 
      If[ !FreeQ[xAct`xTras`Private`tcscanondd, 
         HoldPattern[(xAct`xTras`Private`y_)^(xAct`xTras`Private`x_)] /; 
          xAct`xTras`Private`x < 0 &&  !FreeQ[xAct`xTras`Private`y, Plus]], 
       Message[CollectTensors::denominator]]; xAct`xTras`Private`mod = 
       Collect[xAct`xTras`Private`mod, xAct`xTras`Private`tcscanondd]; 
      xAct`xTras`Private`print["Collected TensorWrappers"]; 
      xAct`xTras`Private`mod = If[ !xAct`xTras`Private`verbose, 
        xAct`xTras`Private`rtc[xAct`xTras`Private`mod /. 
          (xAct`xTras`Private`x_)*(xAct`xTras`Private`y_TensorWrapper) :> 
           xAct`xTras`Private`simplify[xAct`xTras`Private`x]*
            xAct`xTras`Private`y], MapTimedIfPlus[
         xAct`xTras`Private`rtc[#1 /. (xAct`xTras`Private`x_)*
              (xAct`xTras`Private`y_TensorWrapper) :> 
             xAct`xTras`Private`simplify[xAct`xTras`Private`x]*
              xAct`xTras`Private`y] & , xAct`xTras`Private`mod, 
         Description -> "Simplifying coefficient of each term"]]; 
      xAct`xTras`Private`print["Simplified coefficient of each term"]; 
      xAct`xTras`Private`mod]
 
