MapTimed[xAct`xTras`Private`func_, xAct`xTras`Private`expr_, 
      xAct`xTras`Private`levelspec_:{1}, (xAct`xTras`Private`options___)?
       OptionQ] /; LevelSpecQ[xAct`xTras`Private`levelspec] := 
    Module[{xAct`xTras`Private`desc, xAct`xTras`Private`parallel, 
      xAct`xTras`Private`timer, xAct`xTras`Private`ETA, 
      xAct`xTras`Private`length = 0, xAct`xTras`Private`position = 0}, 
     {xAct`xTras`Private`desc, xAct`xTras`Private`parallel} = 
       {Description, Parallelization} /. CheckOptions[
          xAct`xTras`Private`options] /. Options[MapTimed]; 
      If[xAct`xTras`Private`desc === None, xAct`xTras`Private`desc = "", 
       xAct`xTras`Private`desc = StringJoin[" ", ToString[
           xAct`xTras`Private`desc]]; If[StringTake[xAct`xTras`Private`desc, 
           -1] =!= ".", xAct`xTras`Private`desc = StringJoin[
            xAct`xTras`Private`desc, "."]; ]]; 
      Map[xAct`xTras`Private`length++ & , xAct`xTras`Private`expr, 
       xAct`xTras`Private`levelspec]; 
      With[{xAct`xTras`Private`begintime = AbsoluteTime[], 
        xAct`xTras`Private`l = xAct`xTras`Private`length, 
        xAct`xTras`Private`s1 = StringJoin[" **", xAct`xTras`Private`desc, 
          " Parts "], xAct`xTras`Private`s2 = StringJoin["/", 
          ToString[xAct`xTras`Private`length], " done. "]}, 
       xAct`xTras`Private`ETA[xAct`xTras`Private`pos_] := 
         Ceiling[((AbsoluteTime[] - xAct`xTras`Private`begintime)*
            (xAct`xTras`Private`l - xAct`xTras`Private`pos))/
           xAct`xTras`Private`pos]; xAct`xTras`Private`timer[
          xAct`xTras`Private`pos_] := StringJoin[xAct`xTras`Private`s1, 
          ToString[xAct`xTras`Private`pos], xAct`xTras`Private`s2, 
          TimeString[xAct`xTras`Private`ETA[xAct`xTras`Private`pos]], 
          " remaining."]; ]; xAct`xTras`Private`timer[0] = 
       StringJoin[" **", xAct`xTras`Private`desc, " ", 
        ToString[xAct`xTras`Private`length], " parts."]; 
      xAct`xTras`Private`timer[xAct`xTras`Private`length] = 
       StringJoin[" **", xAct`xTras`Private`desc, " Parts ", 
        ToString[xAct`xTras`Private`length], "/", 
        ToString[xAct`xTras`Private`length], " done."]; 
      If[TrueQ[xAct`xTras`Private`parallel] && $VersionNumber >= 7., 
       SetSharedVariable[xAct`xTras`Private`position]; 
        ((UnsetShared[xAct`xTras`Private`position]; #1) & )[
         Monitor[ParallelMap[((xAct`xTras`Private`position++; #1) & )[
             xAct`xTras`Private`func[#1]] & , xAct`xTras`Private`expr, 
           xAct`xTras`Private`levelspec], xAct`xTras`Private`timer[
           xAct`xTras`Private`position]]], 
       Monitor[Map[((xAct`xTras`Private`position++; #1) & )[
           xAct`xTras`Private`func[#1]] & , xAct`xTras`Private`expr, 
         xAct`xTras`Private`levelspec], xAct`xTras`Private`timer[
         xAct`xTras`Private`position]]]]
 
